import React from 'react';
import { Container, Jumbotron } from 'react-bootstrap';
import './MainJumbotron.css';



export const MainJumbotron = () => (
    <Jumbotron fluid>
        <Container class="col-4">nice pic here</Container>
        <Container class="col-4">
            <h1 class="text-secondary-light bg-dark col-4">Blue sky ideas on how to reduce single-use items </h1>
        </Container>

    </Jumbotron>
)
